import React from 'react';
import FarmerCard from './FarmerCard';

function FarmerList({ farmers }) {
  return (
    <div>
      <h2>Producteurs locaux</h2>
      {farmers.map(farmer => (
        <FarmerCard key={farmer.id} farmer={farmer} />
      ))}
    </div>
  );
}

export default FarmerList;
